Skeleton to copy/paste for writing simple completions. Assume a program foo with the following interface: foo -c green|red|blue -s low|high -f <file> -d <dir> -h The completion handler could be implemented as follows in a file called _foo: #compdef _foo foo function _foo_color() { local colors=() colors+=('green:green color') colors+=('red:red color') colors+=('blue:blue color') _describe "color" colors
} function _foo() { _arguments \ "-c[define color]:color:->s_color" \ "-s[select sound]:sound:(low high)" \ "-f[select file]:file:_files" \ "-d[select dir]:dir:_files -/" \ "-h[help]" case $state in s_color) _foo_color;; esac
} _files is a zsh builtin utility function to complete files/dirs see zsh completion functions zsh completion utility functions
